window.bookSummaryJSON = "<p>A side quest adventure in the best-selling world of Awaken Online! </p> <p>Eliza's parents are relentless - forcing her to constantly take extra courses to prepare for college and medical school. Sometimes, it feels like her entire life has already been planned out. </p> <p>Which is why she leaps at the chance to escape into a new virtual reality game, Awaken Online. What she wasn't expecting was to encounter a capricious god and his loyal \"pet\". Or to be chosen as this god's \"avatar\" within the game and forced to tackle a series of asinine quests. </p> <p>Yet she just can't shake the feeling that there is more to the irritating god than first meets the eye. </p> <p>(This story is intended to be book 5 in the Awaken Online series. It should be listened to after <i>Awaken Online: Evolution</i>.)</p>"; 
